import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [CommonModule],
  template: `
    <div class="app">
      <h1>Zigan</h1>
    </div>
  `,
  styles: [`
    .app {
      text-align: center;
      padding: 2rem;
    }
    
    h1 {
      color: #333;
      font-family: Arial, sans-serif;
    }
  `]
})
export class AppComponent {
  title = 'jrweb';
}
